sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
  var AccountsArray=[];

 if(inputs.status_code="200"){

 var responsebody=JSON.parse(inputs.response_body);

 for(var i=0; i<responsebody.recentItems.length;i++){

                                              var accountobj={};
                                              accountobj.name= responsebody.recentItems[i].Name;
                                              accountobj.id= responsebody.recentItems[i].Id;
                                              AccountsArray[i]= accountobj;
                                              }
 outputs.accounts=AccountsArray;

                             }
})(inputs, outputs);

